        netsnmp_table_helper_add_index(table_info, ASN_UNSIGNED);

    table_info->min_column = backupDetailTable_COL_MIN;
    table_info->max_column = backupDetailTable_COL_MAX;

    /***************************************************
     * registering the table with the master agent
     */
    cb.get_value = backupDetailTable_get_value;
    cb.container = netsnmp_container_find("backupDetailTable_primary:"
                                          "backupDetailTable:"
                                          "table_container");
